import useAddSearch from 'hooks/useAddSearch';
import { Nav } from '../assets/clinic-page-1.png';

function MainPage() {
  useAddSearch();
  return (
    <div>
      <img src={nav} alt="" />
      <Main />
    </div>
  );
}

export default MainPage;
